INSERT INTO `ratings` VALUES (1,'2021-05-14 20:07:12','Your (Uber) company is the worst company to do business with. I come out of country first time ever was trying to use your service to get around during my trip to not only to have the worst treatment by not only the drivers but by your support team as well. I plainly do not know why the terms was violated as you stated you only reference to a dang website. That do not explain to a detail what I was being accused of doing as you say I violated terms. I did all the correct guidelines of what was asked. I worn my mask at all times, and I seen a email stating a driver whom NEVER PICKED ME UP REPORTED NOT WEARING A MASK. I tried to use again another time on same trip and booked a pick up and I had confirmed a driver who headed to pick me up cancelled on the same street I was supposed to be pick up on and they (Driver) rated I wasn\'t not wearing a mask. Mind you this driver didn\'t even see me or near my location pick up spot.',8,'Not happy with the service',18,4),(5,'2021-04-26 17:30:22','I’m not huge on ride share or using anything that involves giving my bank info to a company. When using Uber for the first time I was very surprised at how competitive the prices were. Getting a ride from the casino was 79$ from a taxi and 36$ from Uber! I was shocked. The drivers are cool and do there best to make sure I was comfortable. The only bad part is the lack of rewards we can get and the discounts are only temporary and they’re given when they want to give add them to our account. And they come with restrictions. They combined it with Uber eats but they don’t offer it in my area which is a disappointment for sure.',9.5,'Love their service',18,5),(6,'2021-05-17 16:28:32','this is test reviewWhat do you like best?\nThe user interface of the application is really easy and friendly. The team made such a simple yet functional UX that it makes it easy even for my mom to use. A very straightforward method to schedule a meeting or join one.\nReview collected by and hosted on G2.com.\n\nWhat do you dislike?\nThe only thing that Zoom lacks is creating custom links with custom names that can be added to the links. Makes it easier for people to connect. for zoom application',9,'\"One of the smoothest video conferencing apps\"',29,4),(7,'2021-05-14 20:07:43','Zomato Pro individuals will likewise get need conveyance on Zomato. It implies that any request put by a Pro part will leap to the front of the ongoing line when it searches for a Zomato Valet to convey the request. It will prompt the requests getting conveyed 15-20% quicker (on a normal) during top supper times.\n\nThe Zomato Pro membership will likewise return with a cash ensure conspire.\n\nZomato asserted that if a supporter don\'t save 2x the membership expense of Zomato Pro inside the membership time frame, Zomato will auto-discount the membership charge toward the year\'s end.\n\nBeing a calling driven individual, we bear to miss on our eating regimen however never to miss on our cutoff times.\n\nIn any case, not to stress any longer. You can rapidly arrange your number one brisk munchies from one of the closest eateries .\n\nand get something to eat in no while topping off up your stomach and you are back on the path.\n\nWomen, you can appreciate the gatherings as well! .',8,'Offers many discounts.',19,4),(8,'2021-05-14 20:17:06','No hello, how are you and my name is... No help with luggage. No air conditioning. I ask him to turn on the AC and he says no. I took off my mask for a moment to breathe and he gets angrily arrogant and puts us out. I wanted to end the ride but he rudely told us to get out. Did he dislike a ** person in the vehicle? Never had issue with an unfriendly driver. No courtesy; cold and arrogant. $31.00 for that attitude 12:30 am? NO. Driver who took us to the airport was a gentleman and conversational. This one was cold and arrogant. Bye, bye Lyft.',3,'the service provided was poor',20,4),(9,'2021-05-14 21:05:45','After installing this application after long time I felt it was worth because first of all it only allows a class of people whose credit score is above 730 which means it makes us feels we are superior. There are many offers and rewards which are somewhat valuable in terms of cash and third party app discount offers. Paid my credit card bill for first time got some reward which was minimal but satisfiable. Looking for more exciting offers for next time I pay my bill. Thanks.',8.5,'Nice App',22,4),(10,'2021-05-17 16:18:09','I stayed at the OYO Epsilon Stratford recently and I have to admit that I was not expecting much because the price for the night was very low.\n\nWhen I arrived, there was a lovely staff member who gave me such a warm welcome at reception, I was surprised and that made me smile. The layout at reception was very stylish and the floors were very quiet and clean. As I entered my room I immediately noticed how stylish, clean and overall nice it was. The bed was absolutely fabulous, sheets and mattress were super clean (I checked), the bathroom was spotless, there was tea/coffee, a big screen tv and Terminator 2 was just starting when I turned it on (Yes!!).\n\nThen I started thinking about the amount of times I paid more than twice the price £££ for rooms that were the same or less quality.\n\nThe next morning I went to have breakfast downstairs, where I was greeted by a lovely staff member who immediately asked me if I wanted eggs and how would I like them, there was also a large selection of food for breakfast and everything was included in the very low price I paid (W.T.F!).\n\nI love this hotel, I loved my room and most importantly I liked the happy positive staff.\n\nI will definitely stay with them again',8.5,'I highly recommend *****',35,5),(11,'2021-05-17 17:06:31','The arrival on my Allbirds purchase\nWas excellent and faster than the suggested delivery frame. As I work in a Hospital environment I can walk up to 25-35km a day. I am looking forward to wearing my Allbirds to gain better comfort for my feet. Nice stylish footwear good selection on offer and the sizing is spot on also priced very reasonably. A good marketing strategy provides plenty of information about the product and eco friendly which lead me to buying myself a pair.',8.5,'Allbirds for my feet',31,4),(12,'2021-05-17 17:08:21','Share chat app njan Download the app from the Play Store for the first time in years .I really liked the App. It\'s a entertainment app .\n\nLots of funny videos and whatsapp status Videos have People post pictures of status This app lets you add your favorite people as frinds and chat with them.I like the video I posted to Share On Chat. It gave me a gift.Using the shakechat section, we get to know new people and become friends with them .\n\nSome of these features\n\nStatus videos, pichers can be downloaded and annotated\n\nYou can share our Youtube videos website links,\n\nYou can invite friends and chat with them\n\nKai also happens to meet new people and make friends with them\n\nYou can also show your creativity and create fans\n\nOverall, I really liked this app',7.5,'Share chate make frinds , whatsapp status & videos',38,4),(13,'2021-05-17 17:17:39','Maine 11-12th ka 25000 ka subscriptions liye hai par one week ke under hi maine cancel Karney ke liye bola kar bola nahi ho gaa .mere father nahi hai mother bahut mehnat se mere study ke liye paise de hai . Teachers kabhi seriously padhtay nahi hai aapnay personal life discuss kartay hai aur serial wise syllabus nahi padhtay kabhi bhi koi bhi chapter padhtay hai . questions puchnay ka time nahi milta online classes pe padhtay kaha hai . Maine request kiya hai please meri fees refund kar dijye\n\n',0.5,'Don\'t invest your money in this aap .',32,4),(14,'2021-05-17 17:19:03','What do you like best?\nSwiggy is an easy go-to the application whenever you are busy or not in a mood to cook, you can always choose Swiggy , it provides you with different facilities like home delivery, takeout, and pre reservations which helps you save your time as well as you fulfil your needs, the application is user friendly it is also easy to use as it makes your easy y showing various categories like breakfast, lunch, dinner, and other options and one can choose according to their suitability\nReview collected by and hosted on G2.com.\n\nWhat do you dislike?\nThe application sometimes crashes which causes hindrance while ordering food. The application is sometimes doesn\'t properly categorize your food options which are annoying.\nReview collected by and hosted on G2.com.\n\nRecommendations to others considering the product:\nSwiggy is great application, one should definitely try its services, which helps you save your time, one can eat whatever they want to and whenever they want to . it has met all the requirements till now.\nReview collected by and hosted on G2.com.\n\nWhat problems are you solving with the product? What benefits have you realized?\nSwiggy has helped in saving my time and money by letting me home ordering my food, it has also helped in saving money by showing various discounting options',9,'One of best food ordering application',23,4);
