INSERT INTO `startups` VALUES (18,'Uber Technologies, Inc., commonly known as Uber, is an American technology company. Its services include ride-hailing, food delivery (Uber Eats), package delivery, couriers, freight transportation, and, through a partnership with Lime, electric bicycle and motorized scooter rental. The company is based in San Francisco and has operations in over 900 metropolitan areas worldwide.[3] It is one of the largest firms in the gig economy.','uber',4,'2021-05-14 17:32:17','2020-04-18 00:00:00','transport','https://www.logo.wine/a/logo/Uber/Uber-Logo.wine.svg'),(19,'Zomato (/zoʊmɑːtoʊ/) is an Indian multinational restaurant aggregator and food delivery company founded by Pankaj Chaddah and Deepinder Goyal in 2008.[8][9] Zomato provides information, menus and user-reviews of restaurants as well as food delivery options from partner restaurants in select cities.[10] As of 2019, the service is available in 24 countries and in more than 10,000 cities.[11]','zomato',4,'2021-05-04 23:13:45','2020-03-19 00:00:00','food,delivery','data:image/png;base64,'),(20,'Lyft, Inc. develops, markets, and operates a mobile app, offering vehicles for hire, motorized scooters, a bicycle-sharing system, and food delivery. The company is based in San Francisco, California and operates in 644 cities in the United States and 12 cities in Canada.[2]\n\nWith a 30% market share, Lyft is the second-largest ridesharing company in the United States after Uber.[3]','lyft',4,'2021-05-04 22:37:59','2020-02-20 00:00:00','travel,transportation','https://cdn.designrush.com/uploads/inspiration_images/4796/990__1511457945_616_lyft.png'),(22,'CRED is an Indian fintech startup and unicorn,[1][2][3] based out of Bangalore, Karnataka, which was founded in 2018.[4][5][6] CRED\'s main feature is allowing users to make credit card payments through its app for which they get rewarded.[7] Later, CRED added features to allow users to make house rent payments[8] and introduced short-term credit lines.[9] CRED\'s business model and valuation has received criticism for being overvalued and lacking a solid monetization plan.[10][11]\n\nCRED raised funding from DST Global,[12] Sequoia Capital (India),[13][14] and Tiger Global,[15] among other investors, through four rounds of private funding so far[16] and is currently valued at $2.2 billion (April 2021).[17] CRED posted losses of Rs. 360.31 crore in the 2020 fiscal year (FY20),[18] caused primarily due to high expenditure on marketing and advertising.[19] CRED became the official partner (sponsor) for the Indian Premier League for three years from 2020 to 2022,[20][21][22] in a Rs. 120 crore deal.[23] CRED\'s advertising content and videos, often made in-house and featuring celebrities such as Anil Kapoor,[24] Madhuri Dixit[25] and Udit Narayan[26] generated large discourse in news and social media[27][28][29][30] due to their unique advertising strategy, which has received both praise[31] and criticism.[32]','cred',4,'2021-05-04 22:38:28','2017-12-31 00:00:00','finance','https://www.nextbigbrand.in/wp-content/uploads/2019/03/Screen-Shot-2019-03-08-at-9.36.24-PM.png'),(23,'Swiggy is India\'s largest[3][4][5] online food ordering and delivery platform, founded in 2014. Swiggy is based in Bangalore, India, and as of March 2019, was operating in 100 Indian cities.[6] In early 2019, Swiggy expanded into general product deliveries under the name Swiggy Stores.[7][8][4]\n\nIn September 2019, Swiggy launched instant pickup and drop service Swiggy Go.[9] The service is used for a diverse array of items, including laundry and document or parcel deliveries to business clients and retail customers.[10]\n\nSwiggy is operated by Bundl Technologies Private Limited.[1]','swiggy 123',4,'2021-05-14 18:18:53','2013-12-29 00:00:00','food,delivery','https://cdn.worldvectorlogo.com/logos/swiggy-1.svg'),(26,'Flipkart is an Indian e-commerce company, headquartered in Bangalore, Karnataka, India, and incorporated in Singapore as a private limited company.[7] The company initially focused on online book sales before expanding into other product categories such as consumer electronics, fashion, home essentials, groceries, and lifestyle products.\n\nThe service competes primarily with Amazon\'s Indian subsidiary and domestic rival Snapdeal.[8][9] As of March 2017, Flipkart held a 39.5% market share of India\'s e-commerce industry.[10] Flipkart has a dominant position in the apparel segment, bolstered by its acquisition of Myntra, and was described as being \"neck and neck\" with Amazon in the sale of electronics and mobile phones.[11] Flipkart also owns PhonePe, a mobile payments service based on the Unified Payments Interface.','flipkart',4,'2021-05-04 22:43:15','2006-12-27 00:00:00','ecommerce,apparel','https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/5f3d81106163451.5f897528aa41a.jpg'),(29,'Zoom Video Communications, Inc. (stylized as zoom or simply Zoom) is an American communications technology company headquartered in San Jose, California. It provides videotelephony and online chat services through a cloud-based peer-to-peer software platform and is used for teleconferencing, telecommuting, distance education, and social relations.[4][5]\n\nEric Yuan, a former Cisco engineer and executive, founded Zoom in 2011, and launched its software in 2013.[6] Zoom\'s aggressive revenue growth, and perceived ease-of-use and reliability of its software, resulted in a $1 billion valuation in 2017, making it a \"unicorn\" company.[7] The company first became profitable in 2019,[8][9] and completed an initial public offering that year.[10] The company joined the NASDAQ-100 stock index on April 30, 2020.[11]','zoom',4,'2021-05-14 18:07:36','2021-04-28 00:00:00','video,communication','https://seeklogo.com/images/Z/zoom-icon-logo-C552F99BAC-seeklogo.com.png'),(30,'Ola Cabs (stylized as OLΛ) is an Indian multinational ridesharing company offering services that include vehicle for hire and food delivery. The company is based in Bengaluru, Karnataka, India. As of October 2019, Ola was valued at about US$ 6.5 billion[3] A variety of venture capitalists including Softbank have large stakes in the company.[4]\n\nIn January 2018, Ola extended into its first overseas market, Australia, and in New Zealand in September 2018.[5] In March 2019, Ola began its UK operations introducing auto rickshaws in UK. More than 10,000 drivers have applied both in online and offline mode ahead of its launch in London. In February 2020, Ola launched its taxi-hailing services with over 25,000 drivers registered.[6]\n\nIn March 2015, Ola Cabs acquired Bengaluru-based taxi service TaxiForSure for approximately ₹ 1237 crore (US$ 200 million).[7] June 2015 onwards, Ola users gained access to TFS cabs via the Ola mobile application.[8] Later in the year in November, Ola further acquired Geotagg, a trip-planning applications company, for an undisclosed sum.[9]\n\nIn a move to expand beyond cab aggregation, Ola acquired struggling foodtech company Foodpanda with an eye on leveraging the growing food delivery segment business in December 2017.[10] In April 2018, Ola made its second acquisition with Ridlr (formerly Traffline), a public transport ticketing app.[11] Later in August 2018, Ola financed Series A funding of the scooter rent startup Vogo, and again in December, invested another $100 million.[12]\n\nIn March 2019, the Karnataka state transport department suspended Ola\'s operating license for six months for violation of license conditions and violation of Karnataka On-Demand Transportation Technology Aggregator Rules, 2016. This was on account of Ola running bike taxi services though it only had license for four wheeler taxi operations. The company termed the order unfortunate and was looking at working with driving partners to continue functioning. They also claimed to be in touch with authorities to sort things out.[13]','ola cabs',5,'2021-05-17 12:51:25','2010-11-30 00:00:00','transport,travel','https://irfinity.files.wordpress.com/2015/10/ola_logo_green.jpg'),(31,'Allbirds is a New Zealand-American company that designs and sells footwear and apparel.[2] Allbirds\' first shoe was the Wool Runner, which is made from New Zealand superfine merino wool.[3] The company claims to keep the brand as eco-friendly as possible[4] and is a certified B Corporation.[5] In March 2018, the company started offering their footwear with eucalyptus tree fiber.[6] In 2020 they launched their first apparel line for men and women made of sustainable materials.[7] According to a Bloomberg article, AllBirds is part of a direct-to-consumer model boom that act as both maker and seller, in order to avoid the low margins commonly-associated with wholesale selling model.[8]\n\nIn October 2018, the company raised a $50M Series C, bringing its total valuation to $1.4B.[9]','allbirds',5,'2021-05-17 12:54:35','2016-06-01 00:00:00','footwear,clothing','https://cdn.dribbble.com/users/4882472/screenshots/10248226/media/b339c6415392e3bf83162a7d6f0ebb4e.png'),(32,'\'Unacademy\' is an Indian educational technology company, based in Bangalore. Originally created as a YouTube channel in 2010 by Gaurav Munjal,[1] the company was founded in 2015 by Munjal, Roman Saini, and Hemesh Singh.[2][3][4] The company has a network of over 18,000 educators, and offers preparation material for several professional and educational entrance exams. Unacademy lessons are in the form of Live Classes both free and via subscription.\n\nUnacademy started in 2010 as a YouTube channel by Gaurav Munjal. In 2015, Unacademy was officially registered as an education company in Bangalore. A privately held company, Unacademy has secured funding through a series of offerings,[7][8] including investments from US private equity firm General Atlantic, Facebook, Nexus Ventures, Blume Ventures, and Flipkart CEO Kalyan Krishnamurthy.[9] As of December 2020, Unacademy was valued at US$2.0 billion.[10]','unacademy',5,'2021-05-17 12:58:56','2015-01-01 00:00:00','education','https://static.uacdn.net/thumbnail/user/jpeg/w768/eba2b78ba4f041598b0d9d203d6b67ff.jpeg'),(33,'Policybazaar is an Indian insurance aggregator and a global financial technology company based in Gurgaon, India. The company was founded in June 2008 by Yashish Dahiya,[1] Alok Bansal[2] and Avaneesh Nirjar.[3] It provides a digital platform - website and app - where users compare financial services from major insurance companies. The company is India\'s largest insurance aggregator,[4] and has expanded its operations to the United Arab Emirates.\n\nPolicybazaar.com was founded in June 2008 by Yashish Dahiya, Alok Bansal and Avaneesh Nirjar, starting out as an insurance comparison website.[8][7][9] At that time, the Indian insurance industry still lacked transparency and policies were mostly sold through agents.[6] Policybazaar started by listing the details of multiple insurance policies for customers to choose from.[6][10] It began as a price-comparison website,[6] and an information portal for learning about insurance and insurance programs. The website subsequently expanded to becoming a marketplace for insurance policies. In 2015, Policybazaar launched its app[11] for Android and iOS users.\n\nIn February 2020, Sarbvir Singh was appointed CEO effective December 2019 while Yashish Dahiya took over the role of group CEO.','policybazaar',5,'2021-05-17 14:55:15','2008-06-01 00:00:00','finance,','https://pbs.twimg.com/profile_images/1360219032767524868/L6FV3tbv_400x400.png'),(34,'Paytm (a partial abbreviation for \"pay through mobile\") is an Indian e-commerce payment system and financial technology company, based in Noida, Uttar Pradesh, India. Paytm is currently available in 11 Indian languages and offers online use-cases like mobile recharges, utility bill payments, travel, movies, and events bookings as well as in-store payments at grocery stores, fruits and vegetable shops, restaurants, parking, tolls, pharmacies and educational institutions with the Paytm QR code.[5] As of January 2018, Paytm is valued at $10 billion.[6]\n\nAs per the company, over 2 Crore (20 million) merchants across India use their QR code payment system to accept payments directly into their bank account.[7] The company also uses advertisements and paid promotional content to generate revenues.','paytm',5,'2021-05-17 15:01:33','2010-01-01 00:00:00','ecommerce,wallet,payment','https://www.logotaglines.com/wp-content/uploads/2016/08/Paytm-Logo-1200x1200.jpg'),(35,'Oyo Rooms (stylised as OYO), also known as Oyo Hotels & Homes, is an Indian multinational hospitality chain of leased and franchised hotels, homes and living spaces. [1][2][3][4] Founded in 2013 by Ritesh Agarwal, who is also known as world\'s youngest billionaire, OYO initially consisted mainly of budget hotels. The startup expanded globally with thousands of hotels, vacation homes and millions of rooms in India, Malaysia,[5] UAE, Nepal,[6] China, Brazil, Mexico, UK, Philippines, Japan,[7] Saudi Arabia, Sri Lanka,[8] Indonesia, Vietnam, the United States[9] and more.','oyo rooms',5,'2021-05-17 15:10:18','2013-01-17 00:00:00','hotels','https://logodix.com/logo/738765.png'),(36,'Dream11 is an Indian fantasy sports platform[3] that allows users to play fantasy cricket, hockey, football, kabaddi, and basketball.[4][5] In April 2019, Dream11 became the first Indian gaming company to become a unicorn.\nIn 2017, the company partnered with three leagues within cricket, football and basketball. Dream11 became the Official Fantasy Partner for Caribbean Premier League, Indian Super League and US professional basketball league National Basketball Association (NBA).[3] Later in the year, they partnered with the Indian Super League as their official Fantasy Football Partner.[21][22] In November 2017, the NBA, launched a fantasy basketball game in association with Dream11 and launched their official NBA fantasy game on their platform.[23][24]\n\nIn 2018, Dream11 announced its partnership with ICC (International Cricket Council),[25] Pro Kabaddi League,[26] International Hockey Federation (FIH),[27] WBBL and BBL.[28] In 2018, through the above partnership, Dream11 introduced two new games on their platform viz., kabaddi and hockey.\n\nIn October 2019, New Zealand Cricket (NZC) announced Dream11 as the title sponsor for the Super Smash domestic Twenty20 competition.[29] In January 2021, this partnership was extended for another six years until 2026.[30]\n\nOn 18 August 2020, Dream11 won the title sponsorship rights for the 2020 Indian Premier League for ₹ 2.22 billion, after Vivo pulled out for the season.','dream11',5,'2021-05-17 15:16:25','2008-12-17 00:00:00','gambling,','https://upload.wikimedia.org/wikipedia/en/6/62/Logo_of_Dream11.png'),(37,'Zerodha Broking Limited is an Indian financial services company (a member of NSE, BSE, MCX),[6][7] that offers retail and institutional broking, currencies and commodities trading, mutual funds, and bonds. Founded in 2010,[8] the company is headquartered in Bangalore and has physical presence in several major Indian cities.[9][10][11]\n\nAs of December 2020, Zerodha was the largest retail stockbroker in India by active client base, and contributes upwards of 15% of daily retail volumes across Indian stock exchanges.[12]\n\nIn June 2020, Zerodha entered the unicorn club with a self-assessed valuation of about $1 billion.[13][14] This valuation was based on the ESOP buyback exercise the company undertook valuing each share at more than four times of the book value of ₹700 per share','zerodha',5,'2021-05-17 15:26:02','2010-08-15 00:00:00','finance,trade','https://img.theweek.in/content/dam/week/news/biz-tech/images/2020/4/13/Zerodha-Logo.jpg'),(38,'ShareChat is an Indian social media and social networking service, based in Bangalore, India. It was developed by Mohalla Tech Pvt Ltd. and founded by Ankush Sachdeva, Bhanu Pratap Singh and Farid Ahsan.[1] It was incorporated on 8 January 2015. ShareChat has over 180 million monthly active users[2] across 15 Indic languages. The company\'s application offers features that include private messaging, tagging and a personal messaging feature, enabling users to share videos, jokes, songs and other language based social content with other unknown users.','sharechat',5,'2021-05-17 15:36:07','2015-10-15 00:00:00','network,social,','https://upload.wikimedia.org/wikipedia/en/thumb/e/ec/ShareChat_app_logo.png/120px-ShareChat_app_logo.png'),(39,'Urban Company (formerly known as Urban Clap) is an Indian gig marketplace that offers home installation, maintenance and repair services, and home beauty and wellness services.[2] In 2014, the company was founded by Abhiraj Singh Bhal, Varun Khaitan and Raghav Chandra, and they all are cheated money from the customer it\'s proffesional, service provider ,customer care is non professional they done trial and error method in your appliences request you don\'t use urban clapexpanded its service offerings in January 2020.[2][3] In May 2020, Urban Company reported an operating revenue of INR 216 crore and its valuation was at INR 918 crore; the company followed the I-GAAP accounting method.[4] In FY20, the home maintenance and repair services contributed 45% of total revenue and the beauty and wellness services contributed 55% of total revenue. In March 2020, the company was servicing 22 locations within and outside India, had a network of 25,000 professionals, and were performing 800,000 service tasks every month.[','urban company',5,'2021-05-17 15:42:47','2014-01-01 00:00:00','service','https://res.cloudinary.com/urbanclap/image/upload/v1467812027/uc_logo.png'),(40,'Lenskart is an Indian optical prescription eyewear retail chain, based in Faridabad, India. As of September 2019, Lenskart had over stores in 70 cities in India.[1][2] Its manufacturing facility in Delhi manufactures 300,000 glasses a month.[3] Lenskart also has a factory in Zhengzhou (China) which manufactures about 50% of the production.\nThe company had a valuation of $1.5 billion by Dec 2019 after Softbank invested around $275 million.[5] Peyush Bansal, a former Microsoft employee, founded Lenskart in 2010 along with Amit Chaudhary and Sumeet Kapahi.[6] In 2020 Lenskart generated total revenue of Rs.1000 cr. plus[7] Financial backers of Lenskart include TPG Growth, International Finance Corp and Adveq Management.[8] Ratan Tata (of Tata Sons) and S Gopalakrishnan (of Infosys) have also invested in Lenskart.[9] In March 2018 Wipro Chairman Azim Premji invested 400cr in the group taking the valuation of the company to 3000 Crore.[10][9]In 2018 the company became profitable (EBITD).[3]Lenskart launched the eyewear brand John Jacobs in 2017.[11][12] The company is in talks with Japanese group SoftBank as well as the private equity firm Kedaara Capital for investment.[13][1]\n\nIn October 2017, Lenskart\'s first brand ambassador was Katrina Kaif.[14][15] In March 2019 the company hired Bhuvan Bam as their first male brand ambassador.','lenskart',5,'2021-05-17 15:45:45','2010-01-01 00:00:00','eyewear','https://upload.wikimedia.org/wikipedia/en/c/ce/Lenskart_logo.png'),(41,'Hike Messenger, also called Hike Sticker Chat, was an Indian freeware, cross-platform instant messaging (IM), Voice over IP (VoIP) application which was launched on 12 December 2012 by Kavin Bharti Mittal and is now owned by Hike Private Limited.[3] Hike can work offline through SMS and has multi-platform support.[4] The app registration uses standard one time password (OTP) based authentication process.[5] With abundance of low-cost data, Hike decided to go from a single super app strategy to multiple app approach, so that it can focus more on the core messaging capabilities.[6] It has numerous Hikemoji Stickers which can be customized accordingly. From version 6, the user-interface was revised and the app no longer supports features like news, mobile payment, games or jokes.[7] As per CB Insights, $1.4 billion is the valuation of Hike[8] with more than 100 million registered users till August 2016 and 350 employees working from Bengaluru and Delhi.','hike messenger',5,'2021-05-17 15:50:14','2012-01-17 00:00:00','message,chat','https://www.mobilityindia.com/wp-content/uploads/2019/01/hike-logo.jpg');
